import React, { useState, useEffect } from "react";
import "./index.css";

function App() {
  const [data, setData] = useState("");
  let clicker = 0;

  useEffect(() => {
    console.log(`useEffect is in effect`);
    const makeApiCall = async () => {
      const res = await fetch(`https://swapi.dev/api/planets/`);
      const json = await res.json();
      console.log(json);
      setData(json);
    };
    makeApiCall();
  }, []);

  const buttonFunction = () => {
    console.log(`Data incoming:`);
    console.log(data.results[clicker]);
    clicker += 1;
  };

  return (
    <div>
      <div id="background-div"></div>
      <h1 style={{ textAlign: "center" }} id="title" className="StarWarsFont">
        STAR WARS
      </h1>
      <h3
        className="thinnerStarWarsFont"
        style={{ textAlign: "center", width: "400px", margin: "auto" }}
      >
        Connect with a galaxy of nerds just like you!
      </h3>
      <button onClick={buttonFunction}>Click me for Data</button>
    </div>
  );
}

export default App;
